import React, { useState } from 'react';
import CarForm from './CarForm';

const Dashboard = () => {
  const [isAdmin, setIsAdmin] = useState(true); // Simulating admin login status

  if (!isAdmin) {
    return <p>Unauthorized access. Admins only.</p>;
  }

  return (
    <div className="dashboard">
      <h2>Admin Dashboard</h2>
      <CarForm />
      {/* Display car list with edit/delete buttons */}
    </div>
  );
};

export default Dashboard;
